    [],nt"revision_timestamp": "2016-10-15T16:36:30.730168",nt"name": "presquile-national-wildlife-refuge-annual-narrative-report-calendar-year-1982",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Presquile
    NWR outlines Refuge accomplishments during the 1982 calendar year. The report begins
    with an introduction to the Refuge and information about weather conditions and
    land acquisition activities. Research and investigations are summarized. Administration
    topics are included; topics include personnel, youth programs, funding, and safety.
    Habitat management is covered; wetlands, forests, croplands, grasslands, and pest
    control are discussed. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, marsh and water birds, shorebirds,
    raptors, other migratory birds, game mammals, other resident wildlife, fisheries
    resources, and marking and banding. Interpretation and recreation activities are
    outlined; topics include outdoor classrooms, interpretative exhibits, hunting, wildlife
    observation, other wildlife oriented recreation, picnicking, other non-wildlife
    oriented recreation, and law enforcement. Equipment and facilities are discussed;
    subjects include rehabilitation, major maintenance, equipment utilization and replacement,
    communications systems, and energy conservation. Cooperative programs, items of
    interest, and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
